if mibBuilder.loadTexts: docsQosPktClassFlowLabel.setReference('DOCSIS 3.0 MAC and Upper Layer Protocols Interface Specification CM-SP-MULPIv3.0-I08-080522, IPv6 Flow Label section in the Common Radio Frequency Interface Encodings Annex.')
