if mibBuilder.loadTexts: docsQosParamSetEntry.setDescription('The conceptual row of docsQosParamSetTable. The ifIndex key corresponds to the MAC Domain interface of the service flow of this Qos Param Set.')
docsQosParamSetServiceClassName = MibTableColumn((1, 3, 6, 1, 4, 1, 4491, 2, 1, 21, 1, 2, 1, 4), SnmpAdminString().subtype(subtypeSpec=ValueSizeConstraint(0, 15))).setMaxAccess("readonly")
if mibBuilder.loadTexts: docsQosParamSetServiceClassName.setReference('DOCSIS 3.0 MAC and Upper Layer Protocols Interface Specification CM-SP-MULPIv3.0-I08-080522, Service Class Name section in the Common Radio Frequency Interface Encodings Annex.')
