docsQosParamSetPriority = MibTableColumn((1, 3, 6, 1, 4, 1, 4491, 2, 1, 21, 1, 2, 1, 5), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(0, 7))).setMaxAccess("readonly")
if mibBuilder.loadTexts: docsQosParamSetPriority.setReference('DOCSIS 3.0 MAC and Upper Layer Protocols Interface Specification CM-SP-MULPIv3.0-I08-080522, Traffic Priority section in the Common Radio Frequency Interface Encodings Annex.')
if mibBuilder.loadTexts: docsQosParamSetPriority.setStatus('current')
if mibBuilder.loadTexts: docsQosParamSetPriority.setDescription('This attribute represents the relative priority of a Service Flow. Higher numbers indicate higher priority. This priority should only be used to differentiate Service Flow from identical parameter sets. This attribute returns 0 if the referenced parameter is not present in the corresponding DOCSIS QOS Parameter Set or if the parameter is not applicable.')
docsQosParamSetMaxTrafficRate = MibTableColumn((1, 3, 6, 1, 4, 1, 4491, 2, 1, 21, 1, 2, 1, 6), BitRate()).setUnits('bps').setMaxAccess("readonly")
if mibBuilder.loadTexts: docsQosParamSetMaxTrafficRate.setReference('DOCSIS 3.0 MAC and Upper Layer Protocols Interface Specification CM-SP-MULPIv3.0-I08-080522, Maximum Sustained Traffic Rate section in the Common Radio Frequency Interface Encodings Annex.')
if mibBuilder.loadTexts: docsQosParamSetMaxTrafficRate.setStatus('current')
if mibBuilder.loadTexts: docsQosParamSetMaxTrafficRate.setDescription('This attribute represents the maximum sustained traffic rate allowed for this Service Flow in bits/sec. It represents all MAC frame data PDUs from the bytes following the MAC header HCS to the end of the CRC. The number of bytes forwarded is limited during any time interval. The value 0 means no maximum traffic rate is enforced. This attribute applies to both upstream and downstream Service Flows. This attribute returns 0 if the referenced parameter is not present in the corresponding DOCSIS QOS Parameter Set, or if the parameter is not applicable. This attribute will also return 0 if DataRateUnitSetting is enabled and the resulting value cannot be represented in 32 bits. In which case, docsQosParamSetHCMaxTrafficRate should be utilized.')
docsQosParamSetMaxTrafficBurst = MibTableColumn((1, 3, 6, 1, 4, 1, 4491, 2, 1, 21, 1, 2, 1, 7), Unsigned32()).setUnits('bytes').setMaxAccess("readonly")
if mibBuilder.loadTexts: docsQosParamSetMaxTrafficBurst.setReference('DOCSIS 3.0 MAC and Upper Layer Protocols Interface Specification CM-SP-MULPIv3.0-I08-080522, Maximum Traffic Burst section in the Common Radio Frequency Interface Encodings Annex.')
if mibBuilder.loadTexts: docsQosParamSetMaxTrafficBurst.setStatus('current')
if mibBuilder.loadTexts: docsQosParamSetMaxTrafficBurst.setDescription("This attribute specifies the token bucket size in bytes for this parameter set. The value is calculated from the byte following the MAC header HCS to the end of the CRC. This object is applied in conjunction with MaxTrafficRate to calculate maximum sustained traffic rate. If the referenced parameter is not present in the corresponding DOCSIS QOS Parameter Set, this attribute returns 3044 for scheduling types 'bestEffort', 'nonRealTimePollingService' and 'realTimePollingService'. If this parameter is not applicable, it is reported as 0.")
docsQosParamSetMinReservedRate = MibTableColumn((1, 3, 6, 1, 4, 1, 4491, 2, 1, 21, 1, 2, 1, 8), BitRate()).setUnits('bps').setMaxAccess("readonly")
if mibBuilder.loadTexts: docsQosParamSetMinReservedRate.setReference('DOCSIS 3.0 MAC and Upper Layer Protocols Interface Specification CM-SP-MULPIv3.0-I08-080522, Minimum Reserved Traffic Rate section of the Common Radio Frequency Interface Encodings Annex.')
if mibBuilder.loadTexts: docsQosParamSetMinReservedRate.setStatus('current')
if mibBuilder.loadTexts: docsQosParamSetMinReservedRate.setDescription('This attribute specifies the guaranteed minimum rate in bits/sec for this parameter set. The value is calculated from the byte following the MAC header HCS to the end of the CRC. The value of 0 indicates that no bandwidth is reserved. If the referenced parameter is not present in the corresponding DOCSIS QOS Parameter Set, this attribute returns 0. If the parameter is not applicable, it is reported as 0. This attribute will also return 0 if DataRateUnitSetting is enabled and the resulting value cannot be represented in 32 bits. In which case, docsQosParamSetHCMinReservedRate should be utilized.')
docsQosParamSetMinReservedPkt = MibTableColumn((1, 3, 6, 1, 4, 1, 4491, 2, 1, 21, 1, 2, 1, 9), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(0, 65535))).setUnits('bytes').setMaxAccess("readonly")
if mibBuilder.loadTexts: docsQosParamSetMinReservedPkt.setReference('DOCSIS 3.0 MAC and Upper Layer Protocols Interface Specification CM-SP-MULPIv3.0-I08-080522, Assumed Minimum Reserved Rate Packet Size, in the Common Radio Frequency Interface Encodings Annex.')
if mibBuilder.loadTexts: docsQosParamSetMinReservedPkt.setStatus('current')
if mibBuilder.loadTexts: docsQosParamSetMinReservedPkt.setDescription('This attribute specifies an assumed minimum packet size in bytes for which the MinReservedRate will be provided. The value is calculated from the byte following the MAC header HCS to the end of the CRC. If the referenced parameter is omitted from a DOCSIS QOS parameter set, the used and reported value is CMTS implementation and the CM reports a value of 0. If the referenced parameter is not applicable to the direction or scheduling type of the Service Flow, both CMTS and CM report the value 0.')
docsQosParamSetActiveTimeout = MibTableColumn((1, 3, 6, 1, 4, 1, 4491, 2, 1, 21, 1, 2, 1, 10), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(0, 65535))).setUnits('seconds').setMaxAccess("readonly")
if mibBuilder.loadTexts: docsQosParamSetActiveTimeout.setReference('DOCSIS 3.0 MAC and Upper Layer Protocols Interface Specification CM-SP-MULPIv3.0-I08-080522, Timeout for Active QoS Parameters section in the Common Radio Frequency Interface Encodings Annex.')
if mibBuilder.loadTexts: docsQosParamSetActiveTimeout.setStatus('current')
if mibBuilder.loadTexts: docsQosParamSetActiveTimeout.setDescription('This attribute specifies the maximum duration in seconds that resources remain unused on an active service flow before the CMTS signals that both the active and admitted parameter sets are null. The value 0 signifies an infinite amount of time. If the referenced parameter is not present in the corresponding DOCSIS QOS Parameter Set, this attribute returns 0.')
docsQosParamSetAdmittedTimeout = MibTableColumn((1, 3, 6, 1, 4, 1, 4491, 2, 1, 21, 1, 2, 1, 11), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(0, 65535))).setUnits('seconds').setMaxAccess("readonly")
if mibBuilder.loadTexts: docsQosParamSetAdmittedTimeout.setReference('DOCSIS 3.0 MAC and Upper Layer Protocols Interface Specification CM-SP-MULPIv3.0-I08-080522, Timeout for Admitted QoS Parameters section in the Common Radio Frequency Interface Encodings Annex.')
if mibBuilder.loadTexts: docsQosParamSetAdmittedTimeout.setStatus('current')
if mibBuilder.loadTexts: docsQosParamSetAdmittedTimeout.setDescription('This attribute specifies the maximum duration in seconds that resources remain in admitted state before resources must be released. The value of 0 signifies an infinite amount of time. If the referenced parameter is not present in the corresponding DOCSIS QOS Parameter Set, this attribute returns 200.')
docsQosParamSetMaxConcatBurst = MibTableColumn((1, 3, 6, 1, 4, 1, 4491, 2, 1, 21, 1, 2, 1, 12), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(0, 65535))).setUnits('bytes').setMaxAccess("readonly")
if mibBuilder.loadTexts: docsQosParamSetMaxConcatBurst.setReference('DOCSIS 3.0 MAC and Upper Layer Protocols Interface Specification CM-SP-MULPIv3.0-I08-080522, Maximum Concatenated Burst section in the Common Radio Frequency Interface Encodings Annex.')
if mibBuilder.loadTexts: docsQosParamSetMaxConcatBurst.setStatus('current')
if mibBuilder.loadTexts: docsQosParamSetMaxConcatBurst.setDescription("This attribute specifies the maximum concatenated burst in bytes that an upstream Service Flow is allowed. The value is calculated from the FC byte of the Concatenation MAC Header to the last CRC byte of the last concatenated MAC frame, inclusive. The value of 0 specifies no maximum burst. If the referenced parameter is not present in the corresponding DOCSIS QOS Parameter Set, this attribute returns the value of 1522 for scheduling types 'bestEffort', 'nonRealTimePollingService', and 'realTimePollingService'. If the parameter is not applicable, it is reported as 0.")
docsQosParamSetSchedulingType = MibTableColumn((1, 3, 6, 1, 4, 1, 4491, 2, 1, 21, 1, 2, 1, 13), SchedulingType()).setMaxAccess("readonly")
if mibBuilder.loadTexts: docsQosParamSetSchedulingType.setReference('DOCSIS 3.0 MAC and Upper Layer Protocols Interface Specification CM-SP-MULPIv3.0-I08-080522, Service Flow Scheduling Type section in the Common Radio Frequency Interface Encodings Annex.')
if mibBuilder.loadTexts: docsQosParamSetSchedulingType.setStatus('current')
if mibBuilder.loadTexts: docsQosParamSetSchedulingType.setDescription("This attribute specifies the upstream scheduling service used for upstream Service Flow. If the referenced parameter is not present in the corresponding DOCSIS QOS Parameter Set of an upstream Service Flow, this attribute returns the value of 'bestEffort'. For QOS parameter sets of downstream Service Flows, this attribute's value is reported as 'undefined'.")
docsQosParamSetNomPollInterval = MibTableColumn((1, 3, 6, 1, 4, 1, 4491, 2, 1, 21, 1, 2, 1, 14), Unsigned32()).setUnits('microseconds').setMaxAccess("readonly")
if mibBuilder.loadTexts: docsQosParamSetNomPollInterval.setReference('DOCSIS 3.0 MAC and Upper Layer Protocols Interface Specification CM-SP-MULPIv3.0-I08-080522, Polling Interval section in the Common Radio Frequency Interface Encodings Annex.')
if mibBuilder.loadTexts: docsQosParamSetNomPollInterval.setStatus('current')
if mibBuilder.loadTexts: docsQosParamSetNomPollInterval.setDescription("This attribute specifies the nominal interval in microseconds between successive unicast request opportunities on an upstream Service Flow. This attribute applies only to upstream Service Flows with SchedulingType of value 'nonRealTimePollingService', 'realTimePollingService', and 'unsolictedGrantServiceWithAD'. The parameter is mandatory for 'realTimePollingService'. If the parameter is omitted with 'nonRealTimePollingService', the CMTS uses an implementation-dependent value. If the parameter is omitted with 'unsolictedGrantServiceWithAD(5)' the CMTS uses the value of the Nominal Grant Interval parameter. In all cases, the CMTS reports the value it is using when the parameter is applicable. The CM reports the signaled parameter value if it was signaled. Otherwise, it returns 0. If the referenced parameter is not applicable to the direction or scheduling type of the corresponding DOCSIS QOS Parameter Set, both CMTS and CM report this attribute's value as 0.")
docsQosParamSetTolPollJitter = MibTableColumn((1, 3, 6, 1, 4, 1, 4491, 2, 1, 21, 1, 2, 1, 15), Unsigned32()).setUnits('microseconds').setMaxAccess("readonly")
if mibBuilder.loadTexts: docsQosParamSetTolPollJitter.setReference('DOCSIS 3.0 MAC and Upper Layer Protocols Interface Specification CM-SP-MULPIv3.0-I08-080522, Tolerated Poll Jitter section in the Common Radio Frequency Interface Encodings Annex.')
if mibBuilder.loadTexts: docsQosParamSetTolPollJitter.setStatus('current')
if mibBuilder.loadTexts: docsQosParamSetTolPollJitter.setDescription("This attribute specifies the maximum amount of time in microseconds that the unicast request interval may be delayed from the nominal periodic schedule on an upstream Service Flow. This parameter is applicable only to upstream Service Flows with a SchedulingType of 'realTimePollingService' or 'unsolictedGrantServiceWithAD'. If the referenced parameter is applicable but not present in the corresponding DOCSIS QOS Parameter Set, the CMTS uses an implementation-dependent value and reports the value it is using. The CM reports a value of 0 in this case. If the parameter is not applicable to the direction or upstream scheduling type of the Service Flow, both CMTS and CM report this attribute's value as 0.")
docsQosParamSetUnsolicitGrantSize = MibTableColumn((1, 3, 6, 1, 4, 1, 4491, 2, 1, 21, 1, 2, 1, 16), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(0, 65535))).setUnits('bytes').setMaxAccess("readonly")
if mibBuilder.loadTexts: docsQosParamSetUnsolicitGrantSize.setReference('DOCSIS 3.0 MAC and Upper Layer Protocols Interface Specification CM-SP-MULPIv3.0-I08-080522, Unsolicited Grant Size section in the Common Radio Frequency Interface Encodings Annex.')
if mibBuilder.loadTexts: docsQosParamSetUnsolicitGrantSize.setStatus('current')
if mibBuilder.loadTexts: docsQosParamSetUnsolicitGrantSize.setDescription("This attribute specifies the unsolicited grant size in bytes. The grant size includes the entire MAC frame data PDU from the Frame Control byte to the end of the MAC frame. The referenced parameter is applicable only for upstream flows with a SchedulingType of 'unsolicitedGrantServicewithAD' or 'unsolicitedGrantService', and it is mandatory when applicable. Both CMTS and CM report the signaled value of the parameter in this case. If the referenced parameter is not applicable to the direction or scheduling type of the corresponding DOCSIS QOS Parameter Set, both CMTS and CM report this attribute's value as 0.")
docsQosParamSetNomGrantInterval = MibTableColumn((1, 3, 6, 1, 4, 1, 4491, 2, 1, 21, 1, 2, 1, 17), Unsigned32()).setUnits('microseconds').setMaxAccess("readonly")
if mibBuilder.loadTexts: docsQosParamSetNomGrantInterval.setReference('DOCSIS 3.0 MAC and Upper Layer Protocols Interface Specification CM-SP-MULPIv3.0-I08-080522, Nominal Grant Interval section in the Common Radio Frequency Interface Encodings Annex.')
if mibBuilder.loadTexts: docsQosParamSetNomGrantInterval.setStatus('current')
if mibBuilder.loadTexts: docsQosParamSetNomGrantInterval.setDescription("This attribute specifies the nominal interval in microseconds between successive data grant opportunities on an upstream Service Flow. The referenced parameter is applicable only for upstream flows with a SchedulingType of 'unsolicitedGrantServicewithAD' or 'unsolicitedGrantService(6)', and it is mandatory when applicable. Both CMTS and CM report the signaled value of the parameter in this case. If the referenced parameter is not applicable to the direction or scheduling type of the corresponding DOCSIS QOS Parameter Set, both CMTS and CM report this attribute's value as 0.")
docsQosParamSetTolGrantJitter = MibTableColumn((1, 3, 6, 1, 4, 1, 4491, 2, 1, 21, 1, 2, 1, 18), Unsigned32()).setUnits('microseconds').setMaxAccess("readonly")
if mibBuilder.loadTexts: docsQosParamSetTolGrantJitter.setReference('DOCSIS 3.0 MAC and Upper Layer Protocols Interface Specification CM-SP-MULPIv3.0-I08-080522, Tolerated Grant Jitter section in the Common Radio Frequency Interface Encodings Annex.')
if mibBuilder.loadTexts: docsQosParamSetTolGrantJitter.setStatus('current')
if mibBuilder.loadTexts: docsQosParamSetTolGrantJitter.setDescription("This attribute specifies the maximum amount of time in microseconds that the transmission opportunities may be delayed from the nominal periodic schedule. The referenced parameter is applicable only for upstream flows with a SchedulingType of 'unsolicitedGrantServicewithAD' or 'unsolicitedGrantService(6)', and it is mandatory when applicable. Both CMTS and CM report the signaled value of the parameter in this case. If the referenced parameter is not applicable to the direction or scheduling type of the corresponding DOCSIS QOS Parameter Set, both CMTS and CM report this attribute's value as 0.")
