docsQosParamSetTosAndMask = MibTableColumn((1, 3, 6, 1, 4, 1, 4491, 2, 1, 21, 1, 2, 1, 20), OctetString().subtype(subtypeSpec=ValueSizeConstraint(1, 1)).setFixedLength(1)).setMaxAccess("readonly")
if mibBuilder.loadTexts: docsQosParamSetTosAndMask.setReference('DOCSIS 3.0 MAC and Upper Layer Protocols Interface Specification CM-SP-MULPIv3.0-I08-080522, IP Type Of Service (DSCP) Overwrite section in the Common Radio Frequency Interface Encodings Annex; [RFC 3168]; [RFC 3260]; [RFC 2460]; [RFC 791].')
if mibBuilder.loadTexts: docsQosParamSetTosAndMask.setStatus('current')
if mibBuilder.loadTexts: docsQosParamSetTosAndMask.setDescription("This attribute specifies the AND mask for the IP TOS byte for overwriting an IPv4 packet's TOS value or IPv6 packet's Traffic Class value. The IP packet TOS byte is bitwise ANDed with TosAndMask, then the result is bitwise ORed with TosORMask and the result is written to the IP packet TOS byte. A value of 'FF'H for TosAndMask and a value of '00'H for TosOrMask means that the IP Packet TOS byte is not overwritten. This combination is reported if the referenced parameter is not present in a QOS Parameter Set. The IP TOS octet as originally defined in RFC 791 has been superseded by the 6-bit Differentiated Services Field (DSField, RFC 3260) and the 2-bit Explicit Congestion Notification Field (ECN field, RFC 3168). The IPv6 Traffic Class octet RFC 2460 is consistent with that new definition. Network operators SHOULD avoid specifying values of TosAndMask and TosORMask that would result in the modification of the ECN bits. In particular, operators should not use values of TosAndMask that have either of the least-significant two bits set to 0. Similarly, operators should not use values of TosORMask that have either of the least-significant two bits set to 1. Even though this attribute is only enforced by the CMTS, the CM reports the value as signaled in the referenced parameter.")
docsQosParamSetTosOrMask = MibTableColumn((1, 3, 6, 1, 4, 1, 4491, 2, 1, 21, 1, 2, 1, 21), OctetString().subtype(subtypeSpec=ValueSizeConstraint(1, 1)).setFixedLength(1)).setMaxAccess("readonly")
if mibBuilder.loadTexts: docsQosParamSetTosOrMask.setReference('DOCSIS 3.0 MAC and Upper Layer Protocols Interface Specification CM-SP-MULPIv3.0-I08-080522, IP Type Of Service (DSCP) Overwrite section in the Common Radio Frequency Interface Encodings Annex; [RFC 3168]; [RFC 3260]; [RFC 2460]; [RFC 791].')
if mibBuilder.loadTexts: docsQosParamSetTosOrMask.setStatus('current')
if mibBuilder.loadTexts: docsQosParamSetTosOrMask.setDescription('This attribute specifies the OR mask for the IPv4 TOS value or IPv6 Traffic Class value. See the description of TosAndMask for further details. The IP TOS octet, as originally defined in RFC 791 has been superseded by the 6-bit Differentiated Services Field (DSField, RFC 3260) and the 2-bit Explicit Congestion Notification Field (ECN field, RFC 3168). The IPv6 Traffic Class octet RFC 2460 is consistent with that new definition. Network operators SHOULD avoid specifying values of TosAndMask and TosORMask that would result in the modification of the ECN bits.')
docsQosParamSetMaxLatency = MibTableColumn((1, 3, 6, 1, 4, 1, 4491, 2, 1, 21, 1, 2, 1, 22), Unsigned32()).setUnits('microseconds').setMaxAccess("readonly")
