if mibBuilder.loadTexts: docsQosParamSetType.setDescription("This key represents the QoS Parameter Set Type of the Service Flow. The following values are defined: 'active' Indicates the Active QOS parameter set, describing the service currently being provided by the DOCSIS MAC domain to the service flow. 'admitted' Indicates the Admitted QOS Parameter Set, describing services reserved by the DOCSIS MAC domain for use by the service flow. 'provisioned' Indicates the QOS Parameter Set defined in the DOCSIS CM Configuration file for the service flow.")
docsQosParamSetRequestPolicyOct = MibTableColumn((1, 3, 6, 1, 4, 1, 4491, 2, 1, 21, 1, 2, 1, 24), OctetString().subtype(subtypeSpec=ValueSizeConstraint(4, 4)).setFixedLength(4)).setMaxAccess("readonly")
