if mibBuilder.loadTexts: docsQosParamSetRequestPolicyOct.setStatus('current')
if mibBuilder.loadTexts: docsQosParamSetRequestPolicyOct.setDescription("This attribute specifies which transmit interval opportunities the CM omits for upstream transmission requests and packet transmissions. This object takes its default value for downstream Service Flows. Unless otherwise indicated, a bit value of 1 means that a CM must not use that opportunity for upstream transmission. The format of this string enumerated the bits from 0 to 31 from left to right, for example bit 0 corresponds to the left most bit of the fourth octet. (octets numbered from right to left). The bit positions are defined as follows: 'broadcastReqOpp' all CMs broadcast request opportunities 'priorityReqMulticastReq' priority request multicast request opportunities 'reqDataForReq' request/data opportunities for requests 'reqDataForData' request/data opportunities for data 'piggybackReqWithData' piggyback requests with data 'concatenateData' concatenate data 'fragmentData' fragment data 'suppressPayloadHeaders' suppress payload headers 'dropPktsExceedUGSize' A value of 1 means that the service flow must drop packets that do not fit in the Unsolicited Grant size. If the referenced parameter is not present in a QOS Parameter Set, the value of this object is reported as '00000000'H.")
docsQosParamSetBitMap = MibTableColumn((1, 3, 6, 1, 4, 1, 4491, 2, 1, 21, 1, 2, 1, 25), Bits().clone(namedValues=NamedValues(("trafficPriority", 0), ("maxTrafficRate", 1), ("maxTrafficBurst", 2), ("minReservedRate", 3), ("minReservedPkt", 4), ("activeTimeout", 5), ("admittedTimeout", 6), ("maxConcatBurst", 7), ("schedulingType", 8), ("requestPolicy", 9), ("nomPollInterval", 10), ("tolPollJitter", 11), ("unsolicitGrantSize", 12), ("nomGrantInterval", 13), ("tolGrantJitter", 14), ("grantsPerInterval", 15), ("tosOverwrite", 16), ("maxLatency", 17), ("requiredAttrMask", 18), ("forbiddenAttrMask", 19), ("attrAggrMask", 20), ("applicationId", 21), ("multipCntnReqWindow", 22), ("multipBytesReq", 23), ("maxReqPerSidCluster", 24), ("maxOutstandingBytesPerSidCluster", 25), ("maxTotalBytesReqPerSidCluster", 26), ("maximumTimeInSidCluster", 27), ("peakTrafficRate", 28), ("dsResequencing", 29), ("minimumBuffer", 30), ("targetBuffer", 31), ("maximumBuffer", 32), ("aqmEnabled", 33), ("aqmLatencyTarget", 34), ("dataRateUnit", 35)))).setMaxAccess("readonly")
if mibBuilder.loadTexts: docsQosParamSetBitMap.setReference('DOCSIS 3.0 MAC and Upper Layer Protocols Interface Specification CM-SP-MULPIv3.0-I08-080522, Service Flow Encodings section in the Common Radio Frequency Interface Encodings Annex.')
if mibBuilder.loadTexts: docsQosParamSetBitMap.setStatus('current')
if mibBuilder.loadTexts: docsQosParamSetBitMap.setDescription("This attribute indicates the set of QOS Parameter Set parameters actually signaled in the DOCSIS registration or dynamic service request message that created or modified the QOS Parameter Set. A bit is set to 1 when the associated parameter is present in the original request as follows: 'trafficPriority' Traffic Priority 'maxTrafficRate' Maximum Sustained Traffic Rate 'maxTrafficBurst' Maximum Traffic Burst 'minReservedRate' Minimum Reserved Traffic Rate 'minReservedPkt' Assumed Minimum Reserved Rate Packet Size 'activeTimeout' Timeout for Active QoS Parameters 'admittedTimeout' Timeout for Admitted QoS Parameters 'maxConcatBurst' Maximum Concatenated Burst 'schedulingType' Service Flow Scheduling Type 'requestPolicy' Request/Transmission Policy 'nomPollInterval' Nominal Polling Interval 'tolPollJitter' Tolerated Poll Jitter 'unsolicitGrantSize' Unsolicited Grant Size 'nomGrantInterval' Nominal Grant Interval 'tolGrantJitter' Tolerated Grant Jitter 'grantsPerInterval' Grants per Interval 'tosOverwrite' IP Type of Service (DSCP) Overwrite 'maxLatency' Maximum Downstream Latency 'requiredAttrMask' Service Flow Required Attribute Mask 'forbiddenAttrMask Service Flow Forbidden Attribute Mask 'attrAggrMask' Service Flow Attribute Aggregation Mask 'applicationId' Application Identifier 'multipCntnReqWindow' Multiplier to Contention Request Backoff Window 'multipBytesReq' Multiplier to Number of Bytes Requested 'maxReqPerSidCluster' Maximum Requests per SID Cluster 'maxOutstandingBytesPerSidCluster' Maximum Outstanding Bytes per SID Cluster 'maxTotalBytesReqPerSidCluster' Maximum Total Bytes Requested per SID Cluster 'maximumTimeInSidCluster' Maximum Time in the SID Cluster 'peakTrafficRate' Peak Traffic Rate 'dsResequencing' Downstream Resequencing 'minimumBuffer' Minimum Buffer 'targetBuffer' Target Buffer 'maximumBuffer' Maximum Buffer -- XXX IATC stuff here?!? 'aqmDisabled' SF AQM Disabled 'aqmLatencyTarget' SF AQM Latency Target 'dataRateUnit' Data Rate Unit Setting Note that when Service Class names are expanded, the registration or dynamic response message may contain parameters expanded by the CMTS based on a stored service class. These expanded parameters are not indicated by a 1 bit in this attribute. Note that even though some QOS Parameter Set parameters may not be signaled in a message (so that the parameter's bit in this object is 0), the DOCSIS specification requires that default values be used. These default values are reported as the corresponding attribute.")
